let hCaptcha = false;

function checkState() {
  const checkbox = document
    .getElementById('agreeCheckbox')
    .checked;
  document
    .getElementById('submitButton')
    .disabled = !(
      checkbox && hCaptcha
    );
};

function onCaptchaSuccess(token) {
  hCaptcha = true;
  checkState();
};

document
  .getElementById('agreeCheckbox')
  .addEventListener('change', () => {
  checkState();
});


